// homepage.js

import React from "react";

const Homepage = () => {
  return (
    <div className="homepage">
      <header>
        <h1>Your App Name</h1>
      </header>
      <main>
        <section className="intro">
          <h2>Welcome to Your Task Management</h2>
          <p>Get organized and manage your tasks effortlessly.</p>
        </section>
        <section className="cta">
          <button>Get Started</button>
        </section>
      </main>
    </div>
  );
};

export default Homepage;
